import styled from "styled-components";

export const CupideonHomeWrapper = styled.div`
  height: 100vh;
  width: 100vw;
  background: wheat;
  position: relative;
`

export const CupideonLogoWrapper = styled.div`
  height: 90px;
  width: 100%;
`

export const CupideonHomeLogo = styled.img`
  position: absolute;
  height: 90px;
  filter: invert(17%) sepia(46%) saturate(4795%) hue-rotate(334deg) brightness(106%) contrast(84%);
  left: calc(50% - 38px);
`

export const LoveTitle = styled.h1`
  font-family: Raleway;
  font-weight: bold;
  color: #C42847;
  margin-left: 20px;
`
